const getRandomImageUrl=(itemName)=> {
    if (image[itemName]) {
        const urls = image[itemName];
        const randomIndex = Math.floor(Math.random() * urls.length);
        return urls[randomIndex];
    } else {
        return undefined; 
    }
}

